import { Alert } from 'react-bootstrap'
function Messageloginscreen() {
  return (
    <Alert  variant='danger'  dismissible>Request Failed With Status Code 404<button type="button" class="btn-close" data-bs-dismiss="alert" aria-label="Close"></button></Alert>
  )
}

export default Messageloginscreen
